<html><head><meta http-equiv="Content-Type" content="text/html; charset=windows-1252">
<meta http-equiv="Content-Security-Policy" content="object-src &#39;none&#39;; script-src &#39;unsafe-inline&#39;; base-uri &#39;none&#39;; require-trusted-types-for &#39;script&#39;; report-to officeextensibility-csp-endpoint">
<title>SDX Asset Prefetcher</title>
<script>

var validOriginDomain = new RegExp("^https://.*\\.officeapps\\.live\\.com$");
window.addEventListener("message", function (event) {
    if (validOriginDomain.test(event.origin)) {
        try {
            if (event.data.action == "prefetch") {
                if (event.data.type == 'link') {
                    event.data.urls.forEach(function (url) {
                        var el = document.createElement('link');
                        el.rel = 'prefetch';
                        el.href = url;
                        document.getElementsByTagName('head')[0].appendChild(el);
                    });
                }
            }
        } catch (e) {

        }
    }
}, false);
</script>
